(9, 16, NULL, 'CANCHA DE HOCKEY. RAMON BOGADO', 'POR FAVOR MARIO. EN EL TRANSCURSO DEL DIA DEBEMOS LLEVAR A LA CANCHA DE HOCKEY. 10 LITROS DE NAFTA SUPER, ACEITE 2T Y RETIRAR CARRETILLA, 2 PALAS ANCHAS Y UN BOLSON VACIO. GRACIAS', '2025-08-20 09:03:46', '2025-08-19', NULL, '2025-08-20 13:11:02', 'finalizada', 4, 'media', 0, '', NULL, NULL),
(10, 10, NULL, 'NUEVO PEDIDO/HIERROS-MISION LAISHI', 'POR FAVOR. PREPARAR NUVO PEDIDO DE HIERROS P/MISION LAISHI. DURAN NOS DARA UNA MANO EN ESE SENTIDO. GRACIAS', '2025-08-20 09:05:36', '2025-08-19', NULL, '2025-08-20 12:00:17', 'finalizada', 4, 'media', 0, '', NULL, NULL),
(11, 21, NULL, 'TRANSPORTE DE MATERIALES/BCO PGUA', 'BUENAS TARDES VICTOR. EN EL DIA 20/08/2025 SE PROCEDERA A LA CARGA DEL CAMION POR LA TARDE CON MATERIALES CON DESTINO A OBRA BCO PAYAGUA. CON HOR DE SALIDA 07:20 DEL DIA 21/08. POR FAVOR. GRACIAS', '2025-08-20 14:52:13', '2025-08-20', NULL, NULL, 'pendiente', 4, 'alta', 0, '', NULL, NULL),
(12, 10, NULL, 'PREPARACION CAMION', 'BUENAS TARDES FER. POR FAVOR. EN EL DIA DE HOY. 16:30 A MAS TARDAR DEBEMOS COMUENZAR CON LA CARGA DE LOS MATERIALES CON DESTINO A BCO PGUA. DE SER POSIBLE IR EMPAQUETANDO Y VIENDO QUE NOS FALTA. POR FAVOR MAÑANA SERIA IDEAL SALIR LO MAS TEMPRANO POSIBLE. GRACIAS', '2025-08-20 14:54:14', '2025-08-19', NULL, '2025-08-20 14:54:13', 'finalizada', 4, 'alta', 0, 'Carga de depósito completo.', NULL, NULL),
(13, 10, NULL, 'PREPARACION CAMION', 'Buenos días Fer. Por favor. al regreso del camión de payagua. preparemos el camión para salir nuevamente a Mision Laishi. Por favor fíjate nuevamente de chequear si es que nos esta faltando algo mas. Gracias', '2025-08-21 07:39:39', '2025-08-20', NULL, '2025-08-22 04:47:04', 'finalizada', 4, 'media', 0, '', NULL, NULL),
(14, 16, NULL, 'OPERATIVO OBRAS PUBLICAS', 'BUENAS TARDES MARIO. MUY POSIBLEMENTE EN EL DIA DE MAÑANA 22/08 TNGAMOS QUE HACER MOVIMIENTOS DE PÍEDRAS CON CAMION Y RETRO. LO UNICO QUE SE SABE QUE SERA EN LA ENTRDA DEL ALBERGUE EVITA FRENTE AL PARAISO DE LOS NIÑOS. CONFIRMAMOS LUGAR Y HORA', '2025-08-21 14:57:12', '2025-08-21', NULL, '2025-08-25 04:10:29', 'finalizada', 4, 'media', 0, '', NULL, NULL),
(15, 21, NULL, 'OPERATIVO OBRAS PUBLICAS', 'BUENAS TARDES DON VICTOR. AL IGUAL QUE MARIO ESTAMOS EN LA ESPERA DE CONFIRMACION PARA EL DIA DE MAÑANA REALIZAR MOVIMIENTO DE CAMION CON PIDRAS Y MAQUINARIA. POR FAVOR NO DEJAR DE ESTAR ATENTO A LAS NUEVAS ORDENES DE MAÑANA. GRACIAS', '2025-08-21 14:58:30', '2025-08-21', NULL, NULL, 'pendiente', 4, 'media', 0, '', NULL, NULL),
(16, 11, 19, 'Actividades de sábado por las mañana', 'Buenas tardes Marcelo. Para los sábados a la mañana voy a necesitar que por favor hagas algunas tareas. orden y barrido de interior de galpones. limpieza de la oficina de abajo y si Lautaro nos deja la llave de su oficina. Muy posiblemente pueda llegar a venir Javier Paniagua a retirar algunas cosas. En ese caso te voy a dejar anotado lo que se le debe entregar. para la limpieza de las oficina te vamos a dejar preparado algunos artículos. de igual modo también le dije a Don Mereles que se pueda encargar del barrido de los exteriores y cocina. gracias', '2025-08-22 15:27:46', '2025-08-22', NULL, '2025-08-23 06:34:25', 'finalizada', 4, 'media', 0, '', 6, NULL),
(17, 4, NULL, 'coordinar Niclis/ Canteros Ariel', 'Coordinar con Ariel Canteros de Transpor Niclis envio de cilindro que sera entregado por Gutierrez', '2025-08-22 17:24:31', '2025-08-24', NULL, '2025-08-25 04:00:06', 'finalizada', 4, 'media', 100, 'BUEOS DIAS. YA SE DESPACHO CON TRASPORTE DE NORDEMAQ EL SABADO POR LA MAÑANA.', NULL, NULL),
(18, 10, NULL, 'Actualizacion. base de datos', 'Buenos días Fer. por favor necesito que me des una mano para actualizar la base de datos del sistema nuevo. ya esta en uso el sistema nuevo pero debemos actualizar la base de datos de las cantidades y si hay o no en el obrador. por favor si no entendes algo avísame y lo vemos. gracias', '2025-08-25 06:54:00', '2025-08-26', NULL, '2025-08-30 10:38:48', 'finalizada', 4, 'alta', 0, 'sistema nuevo/artículos o materiales', NULL, NULL),
