(24, 11, NULL, 'Prepara para envio/Laguna Blanca', 'Buenas tardes Marce. Por favor podrías preparar el pedido de laguna Blanca que hemos buscado hoy. Mañana debería llevar el inge Verón. Por favor ver de remitir y empaquetar', '2025-08-25 13:06:24', '2025-08-24', NULL, '2025-08-25 12:10:11', 'finalizada', 4, 'alta', 100, 'El pedido está listo para ser enviado a la obra', NULL, NULL),
(25, 21, NULL, 'PREPARACION CAMION', 'Buenas tardes Don Víctor. A su regreso por favor tenemos que enviar  la obra del inge Veron. 1 palet de cal común avellaneda y 20 bolsas de cemento avellaneda. por favor. Gracias', '2025-08-25 13:08:09', '2025-08-24', NULL, NULL, 'pendiente', 4, 'alta', 0, '', NULL, NULL),
(26, 10, NULL, 'Actualizacion. base de datos', 'Buenas tardes fer. por favor. como ya te lo habia pedido personalmente. podemos volver a chequear stock de cal (fgh y avellaneda) Cementos y Palet. por favor gracias', '2025-08-25 14:09:14', '2025-08-24', NULL, '2025-08-30 10:38:07', 'finalizada', 4, 'urgente', 0, '', NULL, NULL),
