(30, 11, NULL, 'SEPARAR MERCADERIAS', 'Buenos días Marce. Por favor, para el sábado voy a necesitar que me ayudes con la separación de las mercaderías. Yo ya las voy a dejar arriba y te dejo las listas que quienes serán. En los casos de los fideos es como siempre que le hacemos un  mix para que lleven variado. Ideal también por favor que me puedas limpiar arriba. Gracias', '2025-08-29 12:20:53', '2025-08-29', NULL, '2025-08-31 09:50:36', 'finalizada', 4, 'media', 0, 'Por favor avísame cuando termines la tarea. Cualquier cosa estoy al teléfono.', NULL, NULL),
(31, 11, NULL, 'SEPARAR MERCADERIAS', 'Buenos días Marce. Por favor, para el sábado voy a necesitar que me ayudes con la separación de las mercaderías. Yo ya las voy a dejar arriba y te dejo las listas que quienes serán. En los casos de los fideos es como siempre que le hacemos un  mix para que lleven variado. Ideal también por favor que me puedas limpiar arriba. Gracias', '2025-08-29 12:20:57', '2025-08-29', NULL, '2025-08-31 09:50:11', 'finalizada', 4, 'media', 0, 'Luis bogado ya retiró sus mercaderías el día domingo. Además llevo medio tacho de aceite para motor 15w40', NULL, NULL),
(32, 11, NULL, 'Limpieza', 'Por favor Marce. si sos amable de hacer una limpieza general de la oficina, tirar basura y baño. por favor, te voy a dejar preparado los art de limpieza. Muchas gracias', '2025-08-29 12:22:44', '2025-08-29', NULL, '2025-08-31 09:48:36', 'finalizada', 4, 'media', 0, '', NULL, NULL),
(33, 4, NULL, 'Medicación de los perros', 'Una pastilla blanca por día. A los 10 días a partir de la fecha una rosa. Pendiente la perra de chiki', '2025-09-03 17:34:36', '2025-09-15', NULL, '2025-09-16 13:34:31', 'finalizada', 4, 'alta', 100, '', NULL, NULL),
(34, 11, NULL, 'Sabado por la mañana', 'Buenas tardes Marcelo. Para este finde semana tenemos planificado algunas tareas. Las de siempre, barrido y limpieza. Sábado por la mañana los camiones tatus harán viajes con arena a Misión Laishi, y el camioncito saldrá para banco Payagua con materiales, no tenes que hacer nada solo para estar atento. Sábado por la tarde y domingo por la tarde harán movimiento de piedras finas para el parque industrial. También por favor, tendrías que entregarle cosas al Sr Portillo encargado de Yaguarete. Mercaderias, cubiertas y kit de filtros. Y por las dudas, Damian Quiroz retirara 3 motoguadañas nuevas de la marca Lustof. Por favor no dejes de avisarme cualquier cosa.. Gracias', '2025-09-05 17:10:28', '2025-09-07', NULL, '2025-09-08 05:47:43', 'finalizada', 4, 'media', 0, '', NULL, NULL),
(35, 11, NULL, 'Actualizacion. base de datos', 'BUENOS DIAS MARCE. PARA EL DIA SABADO POR LA MAÑANA POR FAVOR! VOY A NECESITAR QUE NOS AYUDES CON LA ACTUALIZACION DE BASE DE DATOS (CANTIDADES SOBRE TODO) DE CAÑOS DE PVC, CAÑOS DE FUSION, Y CAÑOS GRISES SI LOS HUBIERA. TAMBIEN ORDENAR Y ACTUALIZAR LA BASE DE DATOS EN EL DEPOSITO DE FILTROS QUE ESTA DETRAS DE MI OFICINA. SI ES MAS COMODO PARA VOS PODES USAR LA O LAS COMPUTADORAS QUE ESTEN DISPONIBLES PARA MAYOR COMODIDAD.', '2025-09-12 16:27:05', '2025-09-12', NULL, '2025-09-20 03:39:47', 'finalizada', 4, 'alta', 0, 'CUALQUIER CONSULTA ESTOY AL TELEFONO', NULL, NULL),
(36, 21, NULL, 'PREPARACION CAMION', 'BUENOS DIAS VICTOR. TENEMOS PROGRAMACION PARA EL DIA LUNES A PRIMERA HORA SALIR A MISON LAISHI CON EL PEDIDO DE CALES Y CEMENTOS AVELLANEDA. EL DIA MARTES SALIMOS PARA LAGUNA BLANCA/TRES LAGUNAS. Y EL MIERCOLES SALIMOS PARA PAYAGUA EN ESE ORDEN.', '2025-09-12 16:29:17', '2025-09-14', NULL, NULL, 'pendiente', 4, 'alta', 0, '', NULL, NULL),
(37, 16, NULL, 'CANCHA DE PADEL - REFLECTOR 200W', 'Conseguir 1 reflector de 200w / 6.000k / IP 65', '2025-09-19 08:55:01', '2025-09-21', NULL, '2025-09-25 11:12:41', 'finalizada', 5, 'media', 0, '', NULL, NULL),
(38, 16, NULL, 'ESCUELA SAN ANTONIO', 'BUSCAR DE PARQUE INDUSTRIAL A LA GENTE DE CHIQUI Y LLEVARLO A LA ESCUELA SAN ANTONIO / HERRAMIENTAS + CUERPO DE ANDAMIOS Y 4 PERSONAL', '2025-09-24 18:00:30', '2025-09-24', NULL, '2025-09-25 12:48:11', 'finalizada', 5, 'media', 0, '14HS SALIR HACIA EL PARQUE', NULL, NULL),
(39, 16, NULL, 'Actividades de sábado por la mañana', 'BUENAS TARDES MARIO. POR FAVOR. VAMOS A NECESITAR QUE EL DIA VIERNES A ULTIMA HORA DE LA TARDE (17:00) BUSQUEMOS LA BOBCAT PARA PREPARARLA DEJARLA CON  GASOIL Y LISTA SOBRE SU CARRETON PARA SALIR EL DIA SABADO POR LA MAÑANA A PRIMERA HORA DE LA MAÑANA (7:00HS) CON DESTINO A PAYAGUA EN EL CUAL SE DEBERA HACER TRABAJOS QUE TE INFORMARA EL INGENIERO VERON. COMO SIEMPRE LO HACEMOS ES TERMINAR EL TRABAJO Y VOLVER CON PERSONAL DEL SR MARTINEZ.', '2025-09-25 15:07:49', '2025-09-26', NULL, '2025-09-29 06:33:47', 'finalizada', 4, 'alta', 0, 'POR FAVOR NO DEJES DE AVISAR CUALQUIER COSA. MUCHAS GRACIAS', NULL, NULL),
(40, 10, NULL, 'DESCARGA Y SALIDA DE BATEA', 'BUENAS TARDES FERNANDO. PARA DEJARLO POR ESCRITO LO QUE HABLAMOS PERSONALMENTE. VAMOS A NECESITAR  QUE EL DIA SABADO POR LA MAÑANA TE PRESENTES A TRABAJAR EN EL HORARIO NORMAL PARA REALIZAR EN CONJUNTO CON PERSONAL DEL SR VELAZCO (CHIKI) LA DESCARGA DE LA BATEA DEL SR ROQUE. EL CUAL TRAERA MATERIAL DE OBRA DE BCO PAYAGUA. TENEMOS EL HORARIO DE ENTRADA Y ES HASTA QUE SE TERMINE LA DESCARGA. GRACIAS', '2025-09-25 15:12:20', '2025-09-25', NULL, '2025-09-30 14:59:01', 'finalizada', 4, 'media', 0, 'POR FAVOR POR CUALQUIER INCONVENIENTE PARA EL DIA SABADO NO DEJES DE AVISAR. PARA SABER COMO ORGANIZARNOS. GRACIAS', NULL, NULL),
(41, 11, NULL, 'Actividades de sábado por las mañana', 'BUENOS DIAS MARCE. POR FAVOR VOY A PEDIRTE QUE EL SABADO POR LA MAÑANA ME PREPARES LISTA DE MERCADERIAS. TAMBIEN VOY A NECESITAR QUE ORDENES LOS DEPOSITOS DE ELECTRICIDAD Y DE FERRETERIA(EL QUE ESTA DETRAS DE MI OFICINA. GRACIAS', '2025-09-25 15:23:35', '2025-09-26', NULL, NULL, 'pendiente', 4, 'media', 0, 'POR CUALQUIER CONSULTA ESTOY AL TELEFONO-.', NULL, NULL);
